let pepes = [];
const numPepes = 100;

let width = 400;
let height = 560;

p5.disableFriendlyErrors = true; // disables FES

class PepeIcon {
  constructor(icon, x = 0, y = 0, color = (255, 255, 255, 127)) {
    this.icon = icon;
    this.x = x || Math.random() * width;
    this.y = y || Math.random() * height;

    this.w = 200;
    this.h = 200;
    this.accelX = Math.random() * 5 - 2.5;
    this.accelY = Math.random() * 5 - 2.5;
    this.color = color;
    this.speed = 2 + Math.random() * 15;
    this.speedOffset = this.speed - this.speed / 2;
  }

  checkPos() {
    if (this.x < 0 - this.w) this.x = width;
    if (this.x > width + this.w) this.x = 0 - this.w;
    if (this.y < 0 - this.h) this.y = height;
    if (this.y > height + this.h) this.y = 0 - this.h;
  }
  draw() {
    push();

    translate((this.x += this.accelX), (this.y += this.accelY));
    fill(this.color);
    image(this.icon, 0, 0);

    if (relativeX || (relativeY && frameCount % 20 === 0)) {
      this.accelX = (relativeX / width) * this.speedOffset;
      this.accelY = (relativeY / height) * this.speedOffset;
    }
    pop();
    if (frameCount % 30 == 0) this.checkPos();
  }
}

const timeFunction = (func) => {
  console.time(`${func.name}`);
  func();
  console.timeEnd(`${func.name}`);
};

function drawFrameRate() {
  let fps = frameRate();
  fill(255);
  stroke(0);
  text("FPS: " + fps.toFixed(2), 10, 10);
}

let bg;
let icon;
let canvas;
let isIframe = false;
function preload() {
  try {
    icon = loadImage(
      "data:image/png;base64,"
    );
  } catch (error) {
    icon = loadImage("PEPEFACE.png");
  }

  for (let i = 0; i < numPepes; i++) {
    pepes.push(new PepeIcon(icon));
  }
  if (window.top != window.self) {
    console.log("in iframe!");
    isIframe = true;
    document.querySelector("body").classList.add("in-iframe");
    // In a Frame or IFrame
  } else {
    console.log("not in iframe!");
  }
}

let relativeX, relativeY;

document.addEventListener("mousemove", (event) => {
  // if its in an iframe,

  if (isIframe) {
    let centreX = width / 2;
    let centreY = height / 2;

    relativeX = mouseX - centreX;
    relativeY = mouseY - centreY;
    console.log(relativeX);
  } else {
    relativeX = mouseX;
    relativeY = mouseY;
  }
});

function setup() {
  drawingContext.imageSmoothingEnabled = false;

  canvas = createCanvas(400, 560, P2D);
  pixelDensity(1);

  background(0, Math.random() * 127, 0);
}

function mousePressed() {
  push();
  pepes.shift();

  let p = new PepeIcon(
    icon,
    mouseX - 100,
    mouseY - 100,
    (color = (0, 255, 255, 27))
  );
  pepes.push(p);

  pop();
}

let saveIndex = 0;

function draw() {
  if (frameCount % 5 == 0) {
    push();

    background(78, 126, 4, 30);
    pop();
  }

  if (pepes) {
    for (let pepe in pepes) {
      pepes[pepe].draw();
    }
    window.pepes = pepes;
  }
  window.shouldSave = true;

  if (window.shouldSave) {
    let myNoise = noise(saveIndex / 0.005);
    if (myNoise < 1) {
      saveIndex++;
      // frameRate(5);

      // saveCanvas(canvas, `frames/frame_${saveIndex}`, "png");
    }
  }

  // drawFrameRate();
}
